sap.ui.define(["./BaseController","./AddUserStatusDialog"],function(e,t){"use strict";return e.extend("ein.codes.admin.usermaintain.controller.UserStatus",{onInit(){this.AddUserStatusDialog=new t;const e=this.createJsonModel({isEditable:false,isModified:false});this.setModel(e,"userStatusView")},onAddPress(){const{name:e}=this.AddUserStatusDialog;this.loadFragment({name:e}).then(e=>e.open())},onListItemDeletePress(e){const{listItem:t}=e.getParameters();const s=t.getBindingContextPath();this.userService.deleteUserStatusByPath({model:this.getModel(),resourcePath:s})}})});